import React from "react";
import "./style.css";

const Title = props => (
  <div className="header">
    <div className="title">{props.children}</div>
    <div className="scores">
          Correct Guesses: {propsscore}
          Best Score: {this.state.highScore}
        </div>


  </div>
);

export default Title;
